Sieve of Eratosthenes.code:
#include <bits/stdc++.h>
using namespace std;
vector<bool> sieve(int n){ vector<bool> p(n+1,true); p[0]=p[1]=false;
 for(int i=2;i*i<=n;i++) if(p[i]) for(int j=i*i;j<=n;j+=i) p[j]=false; return p; }
int main(){ auto v=sieve(100); }

Euler Totient (Phi).code:
#include <bits/stdc++.h>
using namespace std;
long long phi(long long n){ long long res = n;
 for(long long i=2;i*i<=n;i++) if(n%i==0){ while(n%i==0) n/=i; res -= res/i; }
 if(n>1) res -= res/n; return res; }
int main(){ cout<<phi(36); }

Divisor Count.code:
